import React from "react";
import styles from "./categoryDropdown.module.css";

function CategoryDropdown() {

  return (
    <div className={styles.dropdownSection}>
      <div>
        <p>여성</p><p>셔츠/블라우스</p>
        <p>니트</p><p>티셔츠</p>
        <p>팬츠</p><p>스커트</p>
        <p>원피스</p>
      </div>
      <div>
      <p>남성</p><p>셔츠</p>
        <p>니트</p><p>티셔츠</p>
        <p>정장</p><p>팬츠</p>
      </div>
      <div>
      <p>아우터</p><p>패딩</p>
        <p>가디건</p><p>집업</p>
        <p>코트</p><p>파카</p>
        <p>자켓</p>
      </div>
      

    </div>
  );
}

export default CategoryDropdown;
